import { createApi, fetchBaseQuery } from "@reduxjs/toolkit/query/react"

export const paymentApi = createApi({
    reducerPath: "paymentApi",
    baseQuery: fetchBaseQuery({
        baseUrl: "/api/v1"
    }),
    tagTypes: ["User"],
    endpoints: (builder) => ({
        getRazorpayPayments: builder.query({
            query: () => `/admin/razorpay/transactions`,
        }),
    })
})

export const { useGetRazorpayPaymentsQuery } = paymentApi;
